          "message": "chore: Simplify internal rules iteration withing PropertyRules (#80)\n\n## Motivation\n\nPreviously the `steps` property of `PropertyRules` used to contain\ndifferent kinds of actions, like conditions, flow control and validation\nrules.\nWhen the logic was cleaned and only rules remained the field was left\nintact as `[]interface{}`.\nThat is no longer necessary and we can safely convert it to a strictly\ntyped `[]validationInterface[T]`.",
