          "distinct": true,
          "id": "61d52f0a8f0a1f6afb8c2f7ca5485f79cbfd2d87",
          "message": "feat: Add valid values field to Plan (#77)\n\n## Motivation\n\nWhen further processing validation plan there's no easy way to access\nthe exact, supported values of for a property.\nWe do have examples, but some rules, like `rules.EQ` or `rules.OneOf`\nare very concrete about what they support.\n\n## Release Notes\n\n`govy.PropertyPlan` now includes `Values` field which is a list of\nstringified valid values expected for the property.\nTypically these values are inferred from `rules.OneOf` or `rules.EQ`\nrules.\nUsers can provide these values for their custom rules by using\n`WithPlanModifiers(govy.RulePlanModifierValidValues(...))`.",
          "timestamp": "2025-05-15T13:26:52+02:00",
          "tree_id": "487de9009f3218fbed035476d2e4e94dff4d1c3d",
          "url": "https://github.com/nobl9/govy/commit/61d52f0a8f0a1f6afb8c2f7ca5485f79cbfd2d87"
