          "message": "chore: Update module github.com/nobl9/govy to v0.17.0 (#112)\n\nThis PR contains the following updates:\n\n| Package | Change | Age | Adoption | Passing | Confidence |\n|---|---|---|---|---|---|\n| [github.com/nobl9/govy](https://redirect.github.com/nobl9/govy) |\n`v0.16.0` -> `v0.17.0` |\n[![age](https://developer.mend.io/api/mc/badges/age/go/github.com%2fnobl9%2fgovy/v0.17.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![adoption](https://developer.mend.io/api/mc/badges/adoption/go/github.com%2fnobl9%2fgovy/v0.17.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![passing](https://developer.mend.io/api/mc/badges/compatibility/go/github.com%2fnobl9%2fgovy/v0.16.0/v0.17.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![confidence](https://developer.mend.io/api/mc/badges/confidence/go/github.com%2fnobl9%2fgovy/v0.16.0/v0.17.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n\n---\n\n### Release Notes\n\n<details>\n<summary>nobl9/govy (github.com/nobl9/govy)</summary>\n\n###\n[`v0.17.0`](https://redirect.github.com/nobl9/govy/releases/tag/v0.17.0)\n\n[Compare\nSource](https://redirect.github.com/nobl9/govy/compare/v0.16.0...v0.17.0)\n\n### What's Changed\n\n####  Features\n\n- feat: Add valid values field to Plan\n([#&#8203;77](https://redirect.github.com/nobl9/govy/issues/77))\n[@&#8203;nieomylnieja](https://redirect.github.com/nieomylnieja)\n> `govy.PropertyPlan` now includes `Values` field which is a list of\nstringified valid values expected for the property.\n> Typically these values are inferred from `rules.OneOf` or `rules.EQ`\nrules.\n> Users can provide these values for their custom rules by using\n`WithPlanModifiers(govy.RulePlanModifierValidValues(...))`.\n\n####  Maintenance\n\n<details>\n<summary>9 changes</summary>\n\n- chore: Update dependency govulncheck to v1\n([#&#8203;90](https://redirect.github.com/nobl9/govy/issues/90))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n- chore: Update dependency cspell to v9.0.1\n([#&#8203;110](https://redirect.github.com/nobl9/govy/issues/110))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n- chore: Update dependency golangci-lint to v1.64.8\n([#&#8203;92](https://redirect.github.com/nobl9/govy/issues/92))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n- chore: Update dependency go to v1.24.2\n([#&#8203;108](https://redirect.github.com/nobl9/govy/issues/108))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n- chore: Update dependency gofumpt to v0.8.0\n([#&#8203;109](https://redirect.github.com/nobl9/govy/issues/109))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n- chore: Update dependency cspell to v9\n([#&#8203;107](https://redirect.github.com/nobl9/govy/issues/107))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n- chore: Update minor and patch Golang dependencies\n([#&#8203;89](https://redirect.github.com/nobl9/govy/issues/89))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n- chore: Update dependency cspell to v8.19.4\n([#&#8203;106](https://redirect.github.com/nobl9/govy/issues/106))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n- chore: Update dependency cspell to v8.19.2\n([#&#8203;105](https://redirect.github.com/nobl9/govy/issues/105))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n\n</details>\n\n</details>\n\n---\n\n### Configuration\n\n **Schedule**: Branch creation - At 12:00 AM through 04:59 AM and 10:00\nPM through 11:59 PM, Monday through Friday ( * 0-4,22-23 * * 1-5 ), Only\non Sunday and Saturday ( * * * * 0,6 ) (UTC), Automerge - At any time\n(no schedule defined).\n\n **Automerge**: Enabled.\n\n **Rebasing**: Whenever PR becomes conflicted, or you tick the\nrebase/retry checkbox.\n\n **Ignore**: Close this PR and you won't be reminded about this update\nagain.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/nobl9/govy).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiI0MC4xMS4xOCIsInVwZGF0ZWRJblZlciI6IjQwLjExLjE4IiwidGFyZ2V0QnJhbmNoIjoibWFpbiIsImxhYmVscyI6WyJkZXBlbmRlbmNpZXMiLCJnb2xhbmciLCJyZW5vdmF0ZSJdfQ==-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
