          "message": "chore: Update module github.com/nobl9/govy to v0.18.0 (#119)\n\nThis PR contains the following updates:\n\n| Package | Change | Age | Adoption | Passing | Confidence |\n|---|---|---|---|---|---|\n| [github.com/nobl9/govy](https://redirect.github.com/nobl9/govy) |\n`v0.17.0` -> `v0.18.0` |\n[![age](https://developer.mend.io/api/mc/badges/age/go/github.com%2fnobl9%2fgovy/v0.18.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![adoption](https://developer.mend.io/api/mc/badges/adoption/go/github.com%2fnobl9%2fgovy/v0.18.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![passing](https://developer.mend.io/api/mc/badges/compatibility/go/github.com%2fnobl9%2fgovy/v0.17.0/v0.18.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![confidence](https://developer.mend.io/api/mc/badges/confidence/go/github.com%2fnobl9%2fgovy/v0.17.0/v0.18.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n\n---\n\n### Release Notes\n\n<details>\n<summary>nobl9/govy (github.com/nobl9/govy)</summary>\n\n###\n[`v0.18.0`](https://redirect.github.com/nobl9/govy/releases/tag/v0.18.0)\n\n[Compare\nSource](https://redirect.github.com/nobl9/govy/compare/v0.17.0...v0.18.0)\n\n### What's Changed\n\n####  Features\n\n- feat: Only print \"for the following properties\" in\nValidatorError.Error() when there is at least one property name\n([#&#8203;117](https://redirect.github.com/nobl9/govy/issues/117))\n[@&#8203;nieomylnieja](https://redirect.github.com/nieomylnieja)\n> `govy.ValidatorError.Error()` now only prints *\"for the following\nproperties\"* when there is at least one property name.\n> If all the property errors have no name, it will simply print\n*\"Validation has failed\"*.\n\n####  Maintenance\n\n<details>\n<summary>4 changes</summary>\n\n- chore: Update dependency go to v1.24.3\n([#&#8203;115](https://redirect.github.com/nobl9/govy/issues/115))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n- chore: Update dependency cspell to v9.0.2\n([#&#8203;116](https://redirect.github.com/nobl9/govy/issues/116))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n- chore: switch to JSON cspell config\n([#&#8203;113](https://redirect.github.com/nobl9/govy/issues/113))\n[@&#8203;nieomylnieja](https://redirect.github.com/nieomylnieja)\n- chore: Update module github.com/nobl9/govy to v0.17.0\n([#&#8203;112](https://redirect.github.com/nobl9/govy/issues/112))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n\n</details>\n\n</details>\n\n---\n\n### Configuration\n\n **Schedule**: Branch creation - At 12:00 AM through 04:59 AM and 10:00\nPM through 11:59 PM, Monday through Friday ( * 0-4,22-23 * * 1-5 ), Only\non Sunday and Saturday ( * * * * 0,6 ) (UTC), Automerge - At any time\n(no schedule defined).\n\n **Automerge**: Enabled.\n\n **Rebasing**: Whenever PR becomes conflicted, or you tick the\nrebase/retry checkbox.\n\n **Ignore**: Close this PR and you won't be reminded about this update\nagain.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/nobl9/govy).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiI0MC4xNi4wIiwidXBkYXRlZEluVmVyIjoiNDAuMTYuMCIsInRhcmdldEJyYW5jaCI6Im1haW4iLCJsYWJlbHMiOlsiZGVwZW5kZW5jaWVzIiwiZ29sYW5nIiwicmVub3ZhdGUiXX0=-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
