          "message": "chore: Update jetpack-io/devbox-install-action action to v0.13.0 (#120)\n\nThis PR contains the following updates:\n\n| Package | Type | Update | Change |\n|---|---|---|---|\n|\n[jetpack-io/devbox-install-action](https://redirect.github.com/jetpack-io/devbox-install-action)\n| action | minor | `v0.12.0` -> `v0.13.0` |\n\n---\n\n### Release Notes\n\n<details>\n<summary>jetpack-io/devbox-install-action\n(jetpack-io/devbox-install-action)</summary>\n\n###\n[`v0.13.0`](https://redirect.github.com/jetify-com/devbox-install-action/releases/tag/v0.13.0)\n\n[Compare\nSource](https://redirect.github.com/jetpack-io/devbox-install-action/compare/v0.12.0...v0.13.0)\n\n#### What's Changed\n\n- feat(action): Add extra-nix-config input for custom nix.conf settings\nby [@&#8203;silvestre](https://redirect.github.com/silvestre) in\n[https://github.com/jetify-com/devbox-install-action/pull/75](https://redirect.github.com/jetify-com/devbox-install-action/pull/75)\n- Bump DeterminateSystems/nix-installer-action from 16 to 17 by\n[@&#8203;dependabot](https://redirect.github.com/dependabot) in\n[https://github.com/jetify-com/devbox-install-action/pull/78](https://redirect.github.com/jetify-com/devbox-install-action/pull/78)\n\n#### New Contributors\n\n- [@&#8203;silvestre](https://redirect.github.com/silvestre) made their\nfirst contribution in\n[https://github.com/jetify-com/devbox-install-action/pull/75](https://redirect.github.com/jetify-com/devbox-install-action/pull/75)\n\n**Full Changelog**:\nhttps://github.com/jetify-com/devbox-install-action/compare/v0.12.0...v0.13.0\n\n</details>\n\n---\n\n### Configuration\n\n **Schedule**: Branch creation - At 12:00 AM through 04:59 AM and 10:00\nPM through 11:59 PM, Monday through Friday ( * 0-4,22-23 * * 1-5 ), Only\non Sunday and Saturday ( * * * * 0,6 ) (UTC), Automerge - At any time\n(no schedule defined).\n\n **Automerge**: Enabled.\n\n **Rebasing**: Whenever PR becomes conflicted, or you tick the\nrebase/retry checkbox.\n\n **Ignore**: Close this PR and you won't be reminded about this update\nagain.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/nobl9/govy).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiI0MC4zMy42IiwidXBkYXRlZEluVmVyIjoiNDAuMzMuNiIsInRhcmdldEJyYW5jaCI6Im1haW4iLCJsYWJlbHMiOlsiZGVwZW5kZW5jaWVzIiwiZ2l0aHViLWFjdGlvbnMiLCJyZW5vdmF0ZSJdfQ==-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
