          "distinct": true,
          "id": "baf73a23449d219d89dd603588dfbb57dbf43e56",
          "message": "fix: Correct govy.Plan rules aggregation and predicates handling (#127)\n\n## Motivation\n\nLet's examine this example:\n\n```go\ntype Slice []string\ntype Foo struct {\n\tSlice Slice\n}\n                                                                            \nvalidator := govy.New(\n\tgovy.For(func(f Foo) Slice { return f.Slice }).\n\t\tWithName(\"Slice\").\n\t\tInclude(govy.New(\n\t\t\tgovy.For(govy.GetSelf[Slice]()).\n\t\t\t\tRules(rules.SliceMaxLength[Slice](1)),\n\t\t)).\n\t\tWhen(func(f Foo) bool { return true }),\n\tgovy.For(func(f Foo) Slice { return f.Slice }).\n\t\tWithName(\"Slice\").\n\t\tWhen(func(f Foo) bool { return true }, govy.WhenDescription(\"when true\")),\n\tgovy.For(func(f Foo) Slice { return f.Slice }).\n\t\tWithName(\"Slice\").\n\t\tWhen(func(f Foo) bool { return true }),\n)\n                                                                            \nplan := govy.Plan(validator)\n```\n\nThis will result in a Plan which looks like this:\n\n```json\n{\n  \"properties\": [\n    {\n      \"path\": \"$.Slice\",\n      \"typeInfo\": {\n        \"name\": \"Slice\",\n        \"kind\": \"[]string\",\n        \"package\": \"github.com/nobl9/govy/pkg/govy_test\"\n      },\n      \"rules\": [\n        {\n          \"description\": \"length must be less than or equal to 1\",\n          \"errorCode\": \"slice_max_length\",\n          \"conditions\": [\n            \"\"\n          ]\n        },\n        {\n          \"description\": \"\",\n          \"conditions\": [\n            \"when true\"\n          ]\n        },\n        {\n          \"description\": \"\",\n          \"conditions\": [\n            \"\"\n          ]\n        }\n      ]\n    }\n  ]\n}\n```\n\nInstead, what' we'd expect to see is:\n\n```json\n{\n  \"properties\": [\n    {\n      \"path\": \"$.Slice\",\n      \"typeInfo\": {\n        \"name\": \"Slice\",\n        \"kind\": \"[]string\",\n        \"package\": \"github.com/nobl9/govy/pkg/govy_test\"\n      },\n      \"rules\": [\n        {\n          \"description\": \"length must be less than or equal to 1\",\n          \"errorCode\": \"slice_max_length\"\n        }\n      ]\n    }\n  ]\n}\n```\n\n## Testing\n\nAdded unit test to cover these scenarios.\n\n## Release Notes\n\nFixed `govy.Plan` rules aggregation, it will no longer produce empty,\nfake rules. The predicates handling in the plan has been fix too, If a\npredicate has no description it will be omitted.",
