          "id": "f75f9db538886eb52b6158f7cb32ed00665f3108",
          "message": "chore: Update module github.com/nobl9/govy to v0.19.0 (#131)\n\nThis PR contains the following updates:\n\n| Package | Change | Age | Adoption | Passing | Confidence |\n|---|---|---|---|---|---|\n| [github.com/nobl9/govy](https://redirect.github.com/nobl9/govy) |\n`v0.18.0` -> `v0.19.0` |\n[![age](https://developer.mend.io/api/mc/badges/age/go/github.com%2fnobl9%2fgovy/v0.19.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![adoption](https://developer.mend.io/api/mc/badges/adoption/go/github.com%2fnobl9%2fgovy/v0.19.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![passing](https://developer.mend.io/api/mc/badges/compatibility/go/github.com%2fnobl9%2fgovy/v0.18.0/v0.19.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![confidence](https://developer.mend.io/api/mc/badges/confidence/go/github.com%2fnobl9%2fgovy/v0.18.0/v0.19.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n\n---\n\n### Release Notes\n\n<details>\n<summary>nobl9/govy (github.com/nobl9/govy)</summary>\n\n###\n[`v0.19.0`](https://redirect.github.com/nobl9/govy/releases/tag/v0.19.0)\n\n[Compare\nSource](https://redirect.github.com/nobl9/govy/compare/v0.18.0...v0.19.0)\n\n### What's Changed\n\n####   Breaking Changes\n\n- feat: Remove IsOptional in favor of a dedicated rule and remove\nduplicate rules from govy.Plan\n([#&#8203;129](https://redirect.github.com/nobl9/govy/issues/129))\n[@&#8203;nieomylnieja](https://redirect.github.com/nieomylnieja)\n> Property `IsOptional` has been removed from `govy.PropertyPlan`. It is\nreplaced with a synthetic `govy.RulePlan` entry with the following\ncontent: `{\"description\":\"property is\noptional\",\"errorCode\":\"optional\"}`.\n\n####  Features\n\n- feat: Remove IsOptional in favor of a dedicated rule and remove\nduplicate rules from govy.Plan\n([#&#8203;129](https://redirect.github.com/nobl9/govy/issues/129))\n[@&#8203;nieomylnieja](https://redirect.github.com/nieomylnieja)\n    > Duplicate rules will now not appear in `govy.Plan`.\n- feat: Add required as a synthetic rule in govy.Plan\n([#&#8203;128](https://redirect.github.com/nobl9/govy/issues/128))\n[@&#8203;nieomylnieja](https://redirect.github.com/nieomylnieja)\n> Properties marked as `Required` will now be reported as having the\nfollowing rule in `govy.Plan`: `{\"description\":\"property is\nrequired\",\"errorCode\":\"required\"}`.\n- feat: Add UniqueProperties rule\n([#&#8203;123](https://redirect.github.com/nobl9/govy/issues/123))\n[@&#8203;nieomylnieja](https://redirect.github.com/nieomylnieja)\n> Added `rules.UniqueProperties` rule which helps ensure given\nproperties have unique values.\n\n####  Bug Fixes\n\n- fix: Correct govy.Plan rules aggregation and predicates handling\n([#&#8203;127](https://redirect.github.com/nobl9/govy/issues/127))\n[@&#8203;nieomylnieja](https://redirect.github.com/nieomylnieja)\n> Fixed `govy.Plan` rules aggregation, it will no longer produce empty,\nfake rules. The predicates handling in the plan has been fix too, If a\npredicate has no description it will be omitted.\n\n####  Maintenance\n\n<details>\n<summary>7 changes</summary>\n\n- chore: Correct docs for Plan\n([#&#8203;125](https://redirect.github.com/nobl9/govy/issues/125))\n[@&#8203;nieomylnieja](https://redirect.github.com/nieomylnieja)\n- chore: Update module golang.org/x/tools to v0.34.0\n([#&#8203;121](https://redirect.github.com/nobl9/govy/issues/121))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n- chore: Update dependency cspell to v9.1.1\n([#&#8203;124](https://redirect.github.com/nobl9/govy/issues/124))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n- chore: add additional plan tests\n([#&#8203;122](https://redirect.github.com/nobl9/govy/issues/122))\n[@&#8203;nieomylnieja](https://redirect.github.com/nieomylnieja)\n- chore: Update jetpack-io/devbox-install-action action to v0.13.0\n([#&#8203;120](https://redirect.github.com/nobl9/govy/issues/120))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n- chore: Update module github.com/nobl9/govy to v0.18.0\n([#&#8203;119](https://redirect.github.com/nobl9/govy/issues/119))\n@&#8203;[renovate\\[bot\\]](https://redirect.github.com/apps/renovate)\n- chore: Update README.md\n([#&#8203;118](https://redirect.github.com/nobl9/govy/issues/118))\n[@&#8203;nieomylnieja](https://redirect.github.com/nieomylnieja)\n\n</details>\n\n</details>\n\n---\n\n### Configuration\n\n **Schedule**: Branch creation - At 12:00 AM through 04:59 AM and 10:00\nPM through 11:59 PM, Monday through Friday ( * 0-4,22-23 * * 1-5 ), Only\non Sunday and Saturday ( * * * * 0,6 ) (UTC), Automerge - At any time\n(no schedule defined).\n\n **Automerge**: Enabled.\n\n **Rebasing**: Whenever PR becomes conflicted, or you tick the\nrebase/retry checkbox.\n\n **Ignore**: Close this PR and you won't be reminded about this update\nagain.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/nobl9/govy).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiI0MC41MC4wIiwidXBkYXRlZEluVmVyIjoiNDAuNTAuMCIsInRhcmdldEJyYW5jaCI6Im1haW4iLCJsYWJlbHMiOlsiZGVwZW5kZW5jaWVzIiwiZ29sYW5nIiwicmVub3ZhdGUiXX0=-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
