          "distinct": true,
          "id": "1d58aaafbc9713ba99015ea4500af65f7d63b701",
          "message": "fix: Harden validation interface (#133)\n\n## Motivation\n\nCurrently, due to how the `validationInterface` is used and defined, we\ncan potentially write this code:\n\n```go\n\tv3 := govy.New(\n\t\tgovy.For(func(f Foo) Foo { return f }).\n\t\t\tRules(\n\t\t\t\tgovy.For(func(f Foo) Foo { return f }),\n\t\t\t),\n\t)\n```\n\nThis is obviously a wrong usage of the `govy.PropertyRules` ad the\n`Rules()` method should only accept either `Rule` or `RuleSet`.\n\nIn order to fix this, we should define a dedicated interface for all 3\ntypes of govy entities --> validator, properties and rules.\n\n## Release Notes\n\n`govy.PropertyRules.Rules()` and related functions will no longer accept\na `govy.Validator` instance.",
          "timestamp": "2025-06-23T13:37:10+02:00",
          "tree_id": "f3fae41a7b1ba011db60ec65a7a2a92fac0c5993",
