          "message": "chore: Update dependency cspell to v9.1.2 (#136)\n\nThis PR contains the following updates:\n\n| Package | Change | Age | Adoption | Passing | Confidence |\n|---|---|---|---|---|---|\n| [cspell](https://cspell.org/)\n([source](https://redirect.github.com/streetsidesoftware/cspell/tree/HEAD/packages/cspell))\n| [`9.1.1` ->\n`9.1.2`](https://renovatebot.com/diffs/npm/cspell/9.1.1/9.1.2) |\n[![age](https://developer.mend.io/api/mc/badges/age/npm/cspell/9.1.2?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![adoption](https://developer.mend.io/api/mc/badges/adoption/npm/cspell/9.1.2?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![passing](https://developer.mend.io/api/mc/badges/compatibility/npm/cspell/9.1.1/9.1.2?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![confidence](https://developer.mend.io/api/mc/badges/confidence/npm/cspell/9.1.1/9.1.2?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n\n---\n\n### Release Notes\n\n<details>\n<summary>streetsidesoftware/cspell (cspell)</summary>\n\n###\n[`v9.1.2`](https://redirect.github.com/streetsidesoftware/cspell/blob/HEAD/packages/cspell/CHANGELOG.md#v912-2025-06-24)\n\n[Compare\nSource](https://redirect.github.com/streetsidesoftware/cspell/compare/v9.1.1...v9.1.2)\n\n##### Fixes\n\n<details>\n<summary>fix: Do not double encode stdin urls (<a\nhref=\"https://redirect.github.com/streetsidesoftware/cspell/pull/7536\">#&#8203;7536</a>)</summary>\n\n##### fix: Do not double encode stdin urls\n([#&#8203;7536](https://redirect.github.com/streetsidesoftware/cspell/pull/7536))\n\nfixes\n[#&#8203;7517](https://redirect.github.com/streetsidesoftware/cspell/issues/7517)\n\n***\n\n</details>\n\n<details>\n<summary>fix: cspell trace output (<a\nhref=\"https://redirect.github.com/streetsidesoftware/cspell/pull/7528\">#&#8203;7528</a>)</summary>\n\n##### fix: cspell trace output\n([#&#8203;7528](https://redirect.github.com/streetsidesoftware/cspell/pull/7528))\n\nIt was incorrectly trimming ansi strings.\n\n***\n\n</details>\n\n##### Dictionary Updates\n\n<details>\n<summary>fix: Workflow Bot -- Update Dictionaries (main) (<a\nhref=\"https://redirect.github.com/streetsidesoftware/cspell/pull/7526\">#&#8203;7526</a>)</summary>\n\n##### fix: Workflow Bot -- Update Dictionaries (main)\n([#&#8203;7526](https://redirect.github.com/streetsidesoftware/cspell/pull/7526))\n\n</details>\n\n---\n\n### Configuration\n\n **Schedule**: Branch creation - At 12:00 AM through 04:59 AM and 10:00\nPM through 11:59 PM, Monday through Friday ( * 0-4,22-23 * * 1-5 ), Only\non Sunday and Saturday ( * * * * 0,6 ) (UTC), Automerge - At any time\n(no schedule defined).\n\n **Automerge**: Enabled.\n\n **Rebasing**: Whenever PR becomes conflicted, or you tick the\nrebase/retry checkbox.\n\n **Ignore**: Close this PR and you won't be reminded about this update\nagain.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/nobl9/govy).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiI0MC42Mi4xIiwidXBkYXRlZEluVmVyIjoiNDAuNjIuMSIsInRhcmdldEJyYW5jaCI6Im1haW4iLCJsYWJlbHMiOlsiZGVwZW5kZW5jaWVzIiwiamF2YXNjcmlwdCIsInJlbm92YXRlIl19-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
