          "distinct": true,
          "id": "9765f6ef04ee695d50e500a4cfc246a38c30063c",
          "message": "fix: Correct govytest.Assert validator name matching (#144)\n\n## Motivation\n\nWhen the actual error checked by `govytest.AssertError` is of type\n`govy.ValidatorError`, both validator name and index are ignored If we\nset them in `govytest.ExpectedRuleError`.\nThis selective behavior is ambiguous and makes it harder check an\nexpected validator name is set for a given `govy.ValidatorError`.\n\n## Release Notes\n\n`govytest.AssertError` will now verify both validator name and index If\nthe actual error is of type `govy.ValidatorError` and if these values\nare provided through `govytest.ExpectedRuleError`.",
          "timestamp": "2025-07-14T13:25:35+02:00",
          "tree_id": "2fd2e9792e0805e5cb4ae0235dc81d994ecd2eba",
