          "distinct": true,
          "id": "efc3a609bf9be8329cf29f85223b454d75f4f534",
          "message": "chore: update Renovate configuration to include allowed commands (#149)\n\n## Motivation\n\nWithout `allowedCommands`, `postUpgradeTasks` won't be allowed to run\nany commands.\n\n## Summary\n\nThe Renovate configuration has been updated to introduce an\n`allowedCommands` field. This field explicitly lists the commands that\nare permitted during post-upgrade tasks, ensuring better control and\nsecurity. The commands include `go work sync`, `make generate`, and\n`make format`. Additionally, the `commands` field in `postUpgradeTasks`\nhas been adjusted to use regular expressions for broader matching of\n`go` and `make` commands.",
          "timestamp": "2025-08-18T10:56:29+02:00",
          "tree_id": "551573a8fa072f4c45076e03d1d67fd5839bea65",
